import React, { useState, useContext } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "./context/AuthContext";
import "./signin.css";
import piggyBankIcon from "./piggyBankIcon.png"; // Add the piggy bank icon image file
import axios from "axios";

const Signin = () => {
    const navigate = useNavigate();
    const { login, setCurrentUser } = useContext(AuthContext);
    const [formData, setFormData] = useState({
    username: "",
    password: "",
    });
    const [error, setError] = useState("");
    const [loading, setLoading] = useState(false);

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError(null);
        
        try {
            // Clear any existing auth data first
            localStorage.removeItem('user');
            
            // Try using the context login function first
            try {
                await login(formData.username, formData.password);
                navigate('/dashboard');
                return; // Exit if successful
            } catch (loginError) {
                console.log("Context login failed, trying direct API call");
                // If context login fails, try direct API call
            }
            
            // Direct API call as fallback
            try {
                // Use relative URL first
                const response = await axios.post('/users/login', {
                    username: formData.username,
                    password: formData.password
                });
                
                // Store the user data in localStorage
                const userData = response.data;
                localStorage.setItem('user', JSON.stringify(userData));
                
                // Update the auth context
                setCurrentUser(userData);
                
                // Redirect to dashboard
                navigate('/dashboard');
            } catch (directApiError) {
                // Try with full URL if relative URL fails
                console.log("Direct API call failed, trying with full URL");
                
                const baseUrl = process.env.REACT_APP_API_URL || '';
                const fullResponse = await axios.post(`${baseUrl}/users/login`, {
                    username: formData.username,
                    password: formData.password
                });
                
                const userData = fullResponse.data;
                localStorage.setItem('user', JSON.stringify(userData));
                setCurrentUser(userData);
                navigate('/dashboard');
            }
        } catch (err) {
            console.error('Login error:', err);
            
            // Show appropriate error message with more details
            if (err.response) {
                console.log("Error response:", err.response);
                if (err.response.status === 401) {
                    setError('Invalid username or password');
                } else if (err.response.data && err.response.data.error) {
                    setError(err.response.data.error);
                } else {
                    setError(`Server error: ${err.response.status}`);
                }
            } else if (err.request) {
                // Request was made but no response received
                console.log("Error request:", err.request);
                setError('No response from server. Please check your connection.');
            } else {
                // Something else caused the error
                setError(`Error: ${err.message}`);
            }
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="signin-container">
        <div className="signin-header">
            <img src={piggyBankIcon} alt="NoSpendy Logo" className="logo" />
            <h1>NoSpendy</h1>
        </div>

        <div className="signin-box">
            <h2>Sign In</h2>
            {error && <p className="error-message">{error}</p>}
            <form onSubmit={handleSubmit}>
            <label>Username:</label>
            <input
                type="text"
                name="username"
                value={formData.username}
                onChange={handleChange}
                required
            />

            <label>Password:</label>
            <input
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                required
            />

            <button type="submit" disabled={loading}>
                {loading ? 'Signing in...' : 'Sign In'}
            </button>
            </form>

            <div className="signin-links">
            <a href="/forgot-password">Forgot Password</a>
            <a href="/createprofile">Create New Account</a>
            </div>
        </div>
        </div>
    );
};

export default Signin;
